const maleNames = [
    "Adam",
    "Ashton",
    "Dave",
    "John",
    "Tom",
    "Henry",
    "Mark",
    "Matthew",
    "William",
    "Robert",
    "Carl",
    "Wesley"
]

const femaleNames = [
    "Mary",
    "Susan",
    "Katherine",
    "Olivia",
    "Pamela",
    "Beatrice",
    "Sandra",
    "Diana",
    "Phoebe",
    "Anna",
    "Christine",
    "Lisa",
    "Vanessa"
]

export const GetMale = () => {
    const firstName = maleNames[Math.random() * maleNames.length];
    const personalPronoun = 'he';
    const objectPronoun = 'him';
    const possessivePronoun = 'his';
    return {firstName, personalPronoun, objectPronoun, possessivePronoun}
}

export const GetFemale = () => {
    firstName = maleNames[Math.random() * femaleNames.length];
    personalPronoun = 'she';
    objectPronoun = 'her';
    possessivePronoun = 'her';
    return {firstName, personalPronoun, objectPronoun, possessivePronoun}
}
